import React, { Component } from "react";
import { Button } from "@material-ui/core";

class AddToBasket extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Button color="primary" variant="contained">
        Buy
      </Button>
    );
  }
}

export default AddToBasket;
